import styled from 'styled-components'

export const Container = styled.div `

  padding: 0;
  margin: 0;
  box-sizing: border-box;
  background: #24292e;
  padding: .5rem 0;

  border: 1px solid red;

`

export const ContainerNav = styled.div `

  max-width: 1280px;
  margin: 0 auto;
  padding: 0 1rem;

  display: flex;
  justify-content: space-between;
  align-items: center;

  nav {
    display: flex;
    justify-content: space-between;
    align-items: center;
    color: white;

    ul {
      display: flex;
      justify-content: space-between;
      align-items: center;
      list-style: none;

      li{
        margin-right: 1rem;
      }
    }
  }

  form {
    input {
      background: transparent;
      border: 1px solid white;
      padding: .5rem .75rem; 
    }
  }

`
